import React from 'react';

const Contact = () => {
  return (
    <div className="container">
      <h1>Contact Us</h1>
      <p>
        We would love to hear from you! If you have any questions or comments, please feel free to reach out to us.
      </p>
      <p>
        <strong>Email:</strong> support@darkwoodsmedia.com
      </p>
      <p>
        <strong>Phone:</strong> (123) 456-7890
      </p>
      <p>
        <strong>Address:</strong> 123 Movie Lane, Film City, FC 12345
      </p>
    </div>
  );
};

export default Contact;
